import React from "react";

export default function VisitsTableData(props) {
  return (
    <table>
      <VisitsTableHeader />
      <tbody>
        {props.visitors?.map((visitor, index) => (
          <tr key={index}>
            <td>{visitor.firstname}</td>
            <td>{visitor.lastname}</td>
            <td>{visitor.email}</td>
            <td>{visitor.phone}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
